import React from "react";
import "../styles/navbar.css";
import logo from "../resource/logo.png";
//import { Link } from 'react-router-dom';
const Navbar = ()=>{
    const changeButton=()=>{
    let menuButtonStyle={
        two: {display:"none"}
    }
    };
    return(
        <div className="navbar">
            <img src={logo} />
            <div onClick={changeButton} className="menuButton">
                <div style={this.menuButtonStyle.two}></div>
                <div></div>
                <div></div>
            </div>
            <div className="menu">
        <nav>
            <a href="#">HOME</a>
            <a href="#">ABOUT</a>
            <a href="#">TEAM</a>
            <a href="#">SERVICES</a>
            <a href="#">WORK</a>
            <a href="#">CLIENTS</a>
            <a href="#">CONTACT</a>
        </nav>
            </div>
        </div>
    )
}
export default Navbar
